import React from "react";
import NavBar from "./NavBar";

import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle.js";
import { Route, Switch } from "react-router";
const App = () => {
  return (
    <>
      <Switch>
        <Route path="" />
        <NavBar />
      </Switch>
    </>
  );
};
export default App;
